import React from 'react';

function Products(){
     return (
        <>
         <div>
            <input type='search' placeholder='search products'/>
         </div>
         <nav>
          <Link to='featured'>Featured</Link>
           <Link to='/new'>New</Link>
         </nav>
         <Outlet/>
        </>
     )
}

export default Products;
